import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import GroupProject from "./Pages/GroupProject";
import Index from "./Pages/index";
import IndividualProject from "./Pages/IndividualProject";
import InternationalProject from "./Data/InternationalProjectData";

function App() {
  return (
    <Router>
      <Routes>
        {/* Other routes */}
        <Route path="/groupProject" element={<GroupProject />} />
        <Route path="/index" element={<Index />} />
        <Route path="/individualProject" element={<IndividualProject />} />
        <Route path="/internationalProject" element={InternationalProject} />
      </Routes>
    </Router>
  );
}
export default App;
